def validateGroupCounts(groups):
        # only two groups,
    if len(groups) > 2:
        return False
    #  and one must have only 1 member char
    if len(groups) == 2 and 1 not in groups.values():
        return False
    # if char has same occurrence, removing any would cause a diff unless they were all 1
    if len(groups) == 1:
        if 1 not in groups.keys():
            return False
        return True
    
    min_grp, max_grp = min(groups.keys()), max(groups.keys())
    if groups[min_grp] == 1 and groups[min_grp] == 1:
        return True
    if groups[max_grp] == 1 and max_grp - 1 == min_grp:
        return True
    return False

def isValid(s):
    # for every char, put in dict with counts
    # iterate through counts, and find
    #   - be 2 different (a, b) at most
    #   - also find number of times a, and b appear (na, nb)
    #   - larger must be greater by only 1 and nx = 1, or smaller must equal 1
    chars = {}
    for c in s:
        chars[c] = chars.get(c, 0) + 1
    
    groups = {}
    for c, cnt in chars.items():
        groups[cnt] = groups.get(cnt, 0) + 1
    
    if validateGroupCounts(groups):
        return 'YES'
    return 'NO'
        

s = ""
print(isValid(s))